import React from 'react'
import { Link } from 'react-router-dom'

function topbar() {
    return (
        <nav>
            <Link to="/">Home</Link>
            <Link to="/ReviewMe">ReviewMe</Link>
            <Link to="/UpdateContactInfo">Update Contact Information</Link>
        </nav>
    )
}

export default topbar
